void update_AI_location(UFO *ufo, int counter); 

volatile int pixel_buffer_start; // global variable

int main(void)
{
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    // declare other variables(not shown)
    // initialize location and direction of rectangles(not shown)

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
	
    UFO ufo1 = {100,120,0,0};
    UFO *ufo1_ptr = &ufo1; 
	UFO ufo2 = {100,100,0,0};
    UFO *ufo2_ptr = &ufo2; 
    char key_pressed = 0;
    char *key_pressed_ptr = &key_pressed;

	clear_screen();
	
	int counter = 0; 
	
    while (1)
    {   
		counter = counter + 1; 
		clear_UFO(ufo1_ptr); 
		clear_UFO(ufo2_ptr); 
        /* Erase any boxes and lines that were drawn in the last iteration */
		
		for(int x = 0; x < 320; x++){
				for(int y = 0; y < 240; y++){
					plot_pixel(x, y, KSI[y][x]);
			}
		}
		
        keyboard_input(key_pressed_ptr);
        draw_UFO(ufo1_ptr, GREEN);
		draw_UFO(ufo2_ptr, RED);
        update_location_UFO(ufo1_ptr, key_pressed);
		update_AI_location(ufo2_ptr, counter); 

        // code for drawing the boxes and lines (not shown)
        // code for updating the locations of boxes (not shown)

        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		if(counter == 7){
			counter = 0; 
		}
    }
}

// code for subroutines (not shown)
void plot_pixel(int x, int y, short int line_color) {
  *(short int * )(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_screen() {
  for (int x = 0; x < RESOLUTION_X; x++) {
    for (int y = 0; y < RESOLUTION_Y; y++) {
	if(*(short int * )(pixel_buffer_start + (y << 10) + (x << 1)) != 0x0000)
      plot_pixel(x, y, 0x0000);
    }
  }
}

void clear_UFO(UFO *ufo) {
  for (int x = ufo->x - 20; x < ufo->x + 20; x++) {
    for (int y = ufo->y - 20; y < ufo->y + 20; y++) {
      plot_pixel(x, y, 0x0000);
  }
}
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color){
    bool is_steep = abs(y1-y0) > abs(x1-x0); 
    if(is_steep){
        swap(&x0, &y0); 
        swap(&x1, &y1); 
    }
    if(x0>x1){
        swap(&x0, &x1); 
        swap(&y0, &y1); 
    }
    int deltax = x1 - x0; 
    int deltay = abs(y1-y0); 
    int error = -(deltax/2); 
    int y = y0; 
    int y_step; 
    if(y0<y1){
        y_step = 1; 
    } else{
        y_step = -1; 
    }
    for(int i = x0; i <= x1; i++){
        if(is_steep){
            plot_pixel (y, i, line_color); 
        } else{
            plot_pixel (i, y, line_color); 
        }
        error = error + deltay; 
        if(error>=0){
            y = y+y_step; 
            error = error - deltax; 
        }
    }
}

void swap(int *x, int *y){
    int temp = *x; 
    *x = *y;
    *y = temp; 
}

void wait_for_vsync() {
    volatile int * pixel_ctrl_ptr = (int*)0xFF203020;
    register int status;
    
    *pixel_ctrl_ptr = 1;
    
    status = *(pixel_ctrl_ptr + 3); 
    while ((status & 0x01) != 0) 
    status = *(pixel_ctrl_ptr + 3); 
}

void keyboard_input(char *keypressed){
    volatile int *PS2_ptr = (int *) 0xFF200100;
    int Data = *PS2_ptr;
    *keypressed = Data & 0xFF;
    while(Data & 0x8000){
        Data = * PS2_ptr;
    }
}

